import {Drawer, Box, Typography, IconButton } from '@mui/material'
import MenuIcon from '@mui/icons-material/Menu'
import {useState} from 'react'
import Button from '@mui/material/Button'
import AnnouncementIcon from '@mui/icons-material/Announcement'
import FactCheckIcon from '@mui/icons-material/FactCheck'
import GroupsIcon from '@mui/icons-material/Groups'
import ScienceIcon from '@mui/icons-material/Science'
import ShowChartIcon from '@mui/icons-material/ShowChart'
import AutoStoriesIcon from '@mui/icons-material/AutoStories'
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';




const MuiDrawer = () => {
    const [isDrawerOpen, setIsDrawerOpen] = useState(false);
    return (
        <>
        <IconButton size='large' edge='start' color='inherit' aria-label='logo' onClick={()=>setIsDrawerOpen(true)}><MenuIcon/></IconButton>
        <Drawer
            anchor='right'
            open={isDrawerOpen}
            onClose={() => setIsDrawerOpen(false)}>
        <Box p={2} width='250px' textAlign='center' role='presentation'>
            <Typography variant='h6' component='div'>
                Side Panel
            </Typography>
            <List>
                <ListItem disablePadding>
                    <ListItemButton><ListItemIcon> <AnnouncementIcon/></ListItemIcon><ListItemText primary="The Problem"/></ListItemButton></ListItem>
                    <ListItemButton><ListItemIcon> <FactCheckIcon/></ListItemIcon><ListItemText primary="The Solution"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <GroupsIcon/></ListItemIcon><ListItemText primary="The Team"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <ShowChartIcon/></ListItemIcon><ListItemText primary="Feasibility Reports"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <ShowChartIcon/></ListItemIcon><ListItemText primary="Design Reports"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <ShowChartIcon/></ListItemIcon><ListItemText primary="Prototype and Mockups"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <ScienceIcon/></ListItemIcon><ListItemText primary="Lab Reports"/></ListItemButton>
                    <ListItemButton><ListItemIcon> <AutoStoriesIcon/></ListItemIcon><ListItemText primary="References, Glossary, and Links"/></ListItemButton>



            </List>

        </Box>
        </Drawer>
        </>
    )
}

export default MuiDrawer;
